import './App.css';
import Header from "./component/Header";
import TodoEditor from "./component/TodoEditor";
import TodoList from "./component/TodoList";
import {useState} from "react";

const mockTodo = [
  {id: 0,isDone: false,content: "React 공부하기",created: new Date().getTime(),},
  {id: 1,isDone: false,content: "빨래널기",created: new Date().getTime(),},
  {id: 2,isDone: false,content: "노래연습하기",created: new Date().getTime(),},
]

function App() {
  const [todo , setTodo] = useState([]);
  return (
    <div className="App">
      {/* <h2>헬로 리액트</h2> */}
      <Header />
      <TodoEditor />
      <TodoList />
    </div>
  );
}

export default App;
